import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { toast } from "react-toastify";

const Profile = () => {
  const navigate = useNavigate();
  const token = localStorage.getItem("token");

  const [userInfo, setUserInfo] = useState(null);
  const [adminProducts, setAdminProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    if (!token) {
      setError("No token found. Please log in.");
      setLoading(false);
      navigate("/login");
      return;
    }

    const fetchUserInfo = async () => {
      try {
        const response = await axios.get(
          "http://localhost:5000/api/users/profile",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );

        const user = response.data;
        setUserInfo(user);

        if (user.isAdmin && user.productsAdded?.length > 0) {
          const productPromises = user.productsAdded.map((id) =>
            axios.get(`http://localhost:5000/api/products/${id}`)
          );
          const productResponses = await Promise.all(productPromises);
          setAdminProducts(productResponses.map((res) => res.data));
        }
      } catch (err) {
        console.error("Error:", err);
        if (err.response?.status === 401) {
          localStorage.removeItem("token");
          navigate("/login");
        }
        setError(err.response?.data?.message || "Failed to fetch data");
      } finally {
        setLoading(false);
      }
    };

    fetchUserInfo();
  }, [token, navigate]);

  const handleLogout = () => {
    localStorage.removeItem("token");
    toast.success("Logged out successfully");
    navigate("/login");
  };

  const handleProductClick = (id) => {
    navigate(`/product/${id}`);
  };

  const handleDeleteProduct = async (productId) => {
    if (!window.confirm("Are you sure you want to delete this product?")) {
      return;
    }

    try {
      await axios.delete(`http://localhost:5000/api/products/${productId}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      alert("Product deleted successfully"); // Changed from toast
      setAdminProducts((prevProducts) =>
        prevProducts.filter((product) => product._id !== productId)
      );
    } catch (error) {
      console.error("Error deleting product:", error);
      alert(error.response?.data?.message || "Failed to delete product"); // Changed from toast
    }
  };

  // const handleLogout = () => {
  //   localStorage.removeItem("token");
  //   alert("Logged out successfully"); // Changed from toast
  //   navigate("/login");
  // };

  const handleUpdateProduct = (productId) => {
    navigate(`/admin/product/${productId}/edit`);
  };

  return (
    <div style={styles.container}>
      <h2>User Profile</h2>
      {loading ? (
        <div style={styles.loadingContainer}>
          <div style={styles.spinner}></div>
          <p>Loading your profile...</p>
        </div>
      ) : error ? (
        <p style={styles.errorText}>{error}</p>
      ) : userInfo ? (
        <div style={styles.profileContainer}>
          <h3 style={styles.username}>{userInfo.name}</h3>
          <p style={styles.infoText}>Email: {userInfo.email}</p>
          <p style={styles.infoText}>
            Joined: {new Date(userInfo.createdAt).toLocaleDateString()}
          </p>

          {userInfo.isAdmin && (
            <div style={styles.adminSection}>
              <h3>Your Added Products</h3>
              {adminProducts.length > 0 ? (
                <div style={styles.productsList}>
                  {adminProducts.map((product) => (
                    <div key={product._id} style={styles.productItem}>
                      <div
                        style={styles.productContent}
                        onClick={() => handleProductClick(product._id)}
                      >
                        <img
                          src={product.image}
                          alt={product.name}
                          style={styles.productImage}
                        />
                        <div style={styles.productDetails}>
                          <strong>{product.name}</strong>
                          <p>${product.price}</p>
                          <p>{product.category}</p>
                        </div>
                      </div>
                      <div style={styles.productActions}>
                        <button
                          style={{ ...styles.actionBtn, ...styles.updateBtn }}
                          onClick={() => handleUpdateProduct(product._id)}
                        >
                          Update
                        </button>
                        <button
                          style={{ ...styles.actionBtn, ...styles.deleteBtn }}
                          onClick={() => handleDeleteProduct(product._id)}
                        >
                          Delete
                        </button>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <p style={styles.noProductsText}>No products added yet</p>
              )}
            </div>
          )}

          <button onClick={handleLogout} style={styles.logoutBtn}>
            Logout
          </button>
        </div>
      ) : (
        <p>Please log in to view your profile.</p>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "2rem",
    maxWidth: "900px",
    margin: "2rem auto",
    backgroundColor: "#f4f7fa",
    borderRadius: "12px",
    boxShadow: "0 8px 24px rgba(0, 0, 0, 0.06)",
  },
  loadingContainer: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    padding: "2rem",
  },
  spinner: {
    border: "4px solid rgba(0, 0, 0, 0.1)",
    width: "36px",
    height: "36px",
    borderRadius: "50%",
    borderLeftColor: "#09f",
    animation: "spin 1s linear infinite",
    marginBottom: "1rem",
  },
  profileContainer: {
    backgroundColor: "#ffffff",
    padding: "2rem",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0, 0, 0, 0.08)",
    marginBottom: "2rem",
    border: "1px solid #e0e0e0",
  },
  username: {
    fontSize: "2rem",
    fontWeight: "700",
    color: "#2c3e50",
    marginBottom: "0.5rem",
  },
  infoText: {
    fontSize: "1.1rem",
    color: "#555",
    margin: "0.3rem 0",
  },
  logoutBtn: {
    padding: "0.6rem 1.4rem",
    backgroundColor: "#dc3545",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    cursor: "pointer",
    marginTop: "1.5rem",
    fontSize: "1rem",
    transition: "all 0.3s ease",
    "&:hover": {
      backgroundColor: "#c82333",
    },
  },
  errorText: {
    color: "#dc3545",
    fontSize: "1.2rem",
    fontWeight: "500",
    marginTop: "1rem",
  },
  adminSection: {
    marginTop: "2rem",
    backgroundColor: "#e9f2ff",
    padding: "1.5rem",
    borderRadius: "10px",
    border: "1px solid #d0e3ff",
  },
  noProductsText: {
    textAlign: "center",
    color: "#666",
    fontStyle: "italic",
    margin: "1rem 0",
  },
  productsList: {
    marginTop: "1.5rem",
    display: "flex",
    flexDirection: "column",
    gap: "1.2rem",
  },
  productItem: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    gap: "1rem",
    padding: "1rem",
    backgroundColor: "#ffffff",
    borderRadius: "10px",
    boxShadow: "0 2px 8px rgba(0, 0, 0, 0.05)",
    transition: "transform 0.2s ease, box-shadow 0.2s ease",
    border: "1px solid #e6e6e6",
  },
  productContent: {
    display: "flex",
    alignItems: "center",
    gap: "1rem",
    flexGrow: 1,
    cursor: "pointer",
  },
  productImage: {
    width: "70px",
    height: "70px",
    objectFit: "cover",
    borderRadius: "8px",
    border: "1px solid #ddd",
  },
  productDetails: {
    display: "flex",
    flexDirection: "column",
  },
  productActions: {
    display: "flex",
    gap: "0.5rem",
  },
  actionBtn: {
    padding: "0.4rem 0.8rem",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "600",
    fontSize: "0.9rem",
    border: "none",
    transition: "background-color 0.3s ease",
  },
  updateBtn: {
    backgroundColor: "#007bff",
    color: "white",
    "&:hover": {
      backgroundColor: "#0069d9",
    },
  },
  deleteBtn: {
    backgroundColor: "#dc3545",
    color: "white",
    "&:hover": {
      backgroundColor: "#c82333",
    },
  },
};

export default Profile;
